import React from 'react'
import {makeStyles} from '@material-ui/core/styles'
import {Container, Typography, Tab, Tabs, Grid} from '@material-ui/core'
import ProjectCard from './ProjectCard'

const useStyles = makeStyles(theme => ({
  root: {
    background: theme.palette.type === "light" ? theme.palette.background.light : theme.palette.background.dark,
    padding: theme.spacing(2),
    marginBottom: theme.spacing(20)
  },
  MuiTabsFlexContainer: {
    centered: true,
    variant: 'fullWidth'
  }
}))



function Projects() {
  const classes = useStyles()
  const [currentTab, setCurrentTab] = React.useState(0)

  return (
    <Container justify="center" align="center" className={classes.root}>
      <Typography variant="h3" style={{textDecoration: "underline"}}>Projects</Typography>
      <Tabs value={currentTab} centered variant='standard' onChange={(e, value) => setCurrentTab(value)}>
        <Tab label="All" />
        <Tab label="React" />
        <Tab label="Django" />
        <Tab label="java" />
      </Tabs>
      <Grid>
        <ProjectCard />
      </Grid>

    </Container>
  )
}

export default Projects
